// frontend/src/countries.js
const countries = [
    { label: "Italy", code: "it" },
    { label: "Croatia", code: "hr" },
    { label: "Greece", code: "gr" },
    { label: "France", code: "fr" },
    { label: "Germany", code: "de" },
    { label: "Spain", code: "es" },
    { label: "United Kingdom", code: "gb" },
    { label: "United States", code: "us" }
];

export default countries;
